import React from "react";
import { useState } from "react";


const Form = () => {

  const [value, SetValue] = useState({
    nombre,
    email
  });



  return (
    <div>
      <form>
        <input
          type="text"
          name="nombre"
          placeholder="Ingresa tu nombre"
          onChange={(e) => SetValue(e.target.value)}
        >
        </input>
        <input
          type="text"
          name="email"
          placeholder="Ingresa tu correo electronico"
          onChange={(e) => SetValue(e.target.value)}
        >
        </input>
      </form>
    </div>
  );
};

export default Form;
